INSERT INTO `ivearscms_article` VALUES ('310', '包装正面有效设计的十个准则', '', '<span style=\"font-size:14px;\">&nbsp;设想，刚从花田里采回来的鲜花被这样包裹在一个特别的包装薄膜里，其中的花儿就像被“催眠”了，五天内不用浇水，无需冷藏</span><img alt=\"\" src=\"http://www.m.com/Public/cab99aaf3402ca58/Picture/20160809121619_93025.jpg\" /> \r\n<p>\r\n	&nbsp;&nbsp;<span style=\"font-size:14px;\">&nbsp;&nbsp;而一旦收花人打开包装，花儿们又可以“醒”过来，绽放九天！</span> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.m.com/Public/cab99aaf3402ca58/Picture/20160809121726_56979.jpg\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;这样和花儿“争夺”氧气的点子想想也只有讲求实用的荷兰人能想出来了</span> \r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;<span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">荷兰一家名为PerfoTec的包装材料公司针对不同蔬菜、水果，根据其需氧量不同量身定做了不同气孔的</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">包装薄膜，使其保鲜时间更长。这项发明在United Fresh年度大会上荣获2016年度产品创新大奖。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:14px;\">蔬菜水果需要呼吸氧气来保持新鲜，但因为季节变换以及品类差异，它们的呼吸频率各不一样，所以如</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">果仅设计一个统一的包装材料来给蔬菜水果保鲜，就不能达到最佳的保鲜效果。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:14px;\">于是乎，PerfoTec公司决定给它们挨个打造独一无二的“外套”</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">量体裁衣的过程是这样的：</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">第一步：利用专利技术迅速测量新鲜水果蔬菜的呼吸频率。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">第二步：通过专门软件计算出所需的包装薄膜上的微气孔。</span><span style=\"font-size:14px;\">&nbsp;</span><br />\r\n<span style=\"font-size:14px;\"> 第三步：PerfoTec激光打孔系统根据测量到的数据通过调整微气孔的数量来生产不同的包装薄膜，以此</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">延长水果蔬菜的存储时间。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:14px;\">文章开始处提到的被装在盒子里的鲜花就是荷兰一个鲜花预订网站目前正在提供的服务，欧盟境内可以</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">直邮网购荷兰鲜花，收到之后，花儿们至少可以绽放9天。</span> \r\n</p>\r\n<img alt=\"\" src=\"http://www.m.com/Public/cab99aaf3402ca58/Picture/20160809121848_20518.jpg\" /><br />\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;除了鲜花，蔬菜水果的保鲜也可以采取类似的包装来保证新鲜度。随着这项可持续创新技术在电商领域的进一步推广应用，无论身处何处，你都有机会品尝到在地球另一端生产的新鲜可口的蔬菜水果，而不用担心路途遥远影响到口味。</span><br />\r\n<span style=\"font-size:14px;\"> &nbsp;&nbsp;&nbsp;&nbsp;从荷兰预订直邮鲜花给心爱的TA？嗯，这一天快来了。</span> \r\n</p>\r\n<br />\r\n<span style=\"font-size:14px;\"></span>', '300', '11', '', '', '', '', '0', '', '包装正面有效设计的十个准则', '0', '0', '6', '1', '', '', '', '0', '2016-08-24 17:14:22', '2016-08-25 09:19:14', '', '', '1');
