 target-output clearfix\">\r\n			<span class=\"\">Vegetables and fruits need to breathe oxygen to keep fresh, but \r\nbecause of seasonal changes and category differences, their respiratory \r\nfrequency is not the same, so as</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">Fruit only to design a unified packaging materials to the fruits and \r\nvegetables, it can not achieve the best effect of preservation.</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">As a result, PerfoTec company decided to build the one and only \"to give them one by one\"</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">A tailored process is this:</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">The first step: the use of patented technology to quickly measure the respiratory rate of fresh fruits and vegetables.</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">The second step: through the special software to calculate the required micro pores on the packaging film.</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">The third step: PerfoTec laser drilling system according to the \r\nmeasured data through the adjustment of the number of micro holes to \r\nproduce different packaging film, in order to</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">Prolong storage time of fruits and vegetables.</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">At the beginning of the references to the loaded in a box of flowers \r\nis the Netherlands a flowers booking website currently is providing \r\nservice, within the territory of the European Union</span> \r\n		</p>\r\n		<p class=\"ordinary-output target-output clearfix\">\r\n			<span class=\"\">Direct mail online shopping Holland flowers, after receipt of the flowers can bloom at least 9 days.</span> \r\n		</p>\r\n	</div>\r\n</span><img alt=\"\" src=\"http://www.m.com/Public/cab99aaf3402ca58/Picture/20160809121848_20518.jpg\" />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">&nbsp;&nbsp;&nbsp; In addition to flowers, fresh vegetables and fruits can also be taken to ensure the freshness of similar packaging. With the sustainable technological innovation in the field of electronic business to further promote the application, wherever, you have the opportunity to taste on the other side of the world production of fresh and delicious fruits and vegetables without worry about the journey is distant to taste.<br />\r\n<br />\r\nDirect mail booking flowers from Holland to love TA? Well, this day is coming.</span><span style=\"font-size:14px;\"></span> \r\n</p>', '301', '11', '', '', '', '', '0', '', 'Ten guidelines for effective design of packaging', '0', '0', '7', '1', '', '', '', '0', '2016-08-25 09:11:59', '2016-08-25 09:12:58', '', '', null);
INSERT INTO `ivearscms_case` VALUES ('3', '雅居乐53栋地暖+地送风式新风解决方案', '{\"url\":[\"\\/Upload\\/201608111424552690.jpg\"],\"name\":[\"case-img.jpg\"]}', '272', '11', '<div class=\"singlebox\">\r\n	<div class=\"singletitle\">\r\n		<p>\r\n			建筑情况\r\n		</p>\r\n		<p>\r\n			<hr />\r\n		</p>\r\n	</div>\r\n	<div class=\"singleContent\">\r\n		房型：公寓楼一套四<br />\r\n建筑面积：162㎡ <br />\r\n采暖面积：135㎡<br />\r\n保温性能：墙体保温不好<br />\r\n		<p>\r\n			地面材料：客厅铺设地砖，卧室为 木地板\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n	</div>\r\n</div>\r\n<div class=\"singlebox\">\r\n	<div class=\"singletitle\">\r\n		<p>\r\n			业主情况\r\n		</p>\r\n		<p>\r\n			<hr />\r\n		</p>\r\n	</div>\r\n	<div class=\"singleContent\">\r\n		业主:   X X X女士<br />\r\n		<p>\r\n			业主情况：一对夫妇，一位小孩\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n	</div>\r\n</div>\r\n<div class=\"singlebox\">\r\n	<div class=\"singletitle\">\r\n		<p>\r\n			业主特别要求\r\n		</p>\r\n		<p>\r\n			<hr />\r\n		</p>\r\n	</div>\r\n	<div class=\"singleContent\">\r\n		<p>\r\n			1、 房间采用水暖。\r\n		</p>\r\n		<p>\r\n			2、 业主要求采用新风系统。\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n	</div>\r\n</div>\r\n<div class=\"singlebox\">\r\n	<div class=\"singletitle\">\r\n		<p>\r\n			难点分析及专家建议\r\n		</p>\r\n		<p>\r\n			<hr />\r\n		</p>\r\n	</div>\r\n	<div class=\"singleContent\">\r\n		<p>\r\n			1、 由于建筑物体承重墙过量过多，不宜开孔\r\n		</p>\r\n		<p>\r\n			2、 采用地送风式新风\r\n		</p>\r\n		<p>\r\n			3、 锅炉采用意大利比安易”24kw。\r\n		</p>\r\n		<p>\r\n			4、 水地暖管材采用上海“林峰”\r\n		</p>\r\n		<p>\r\n			5、 进水管道采用大连“金德”\r\n		</p>\r\n		<p>\r\n			6、 新风机采用“绿岛风”热交换机\r\n		</p>\r\n	</div>\r\n</div>', '2016-07-22 09:51:42');
