INSERT INTO `ivearscms_page` VALUES ('146', '/Upload/image/201608/24/20160824165110_69902.jpg', '世界顶端印刷设备', '世界顶端印刷设备', '145', '全面实行ISO9001质量管理体系，以国际一流的设备、高水准的技术、环保的原料及工艺实现流程化作业，先后获得了FSC和ISO14001认证。公司先后引进全新德国海德堡、高宝大对开四色、五色印刷机', '1', '1', '', '', '', '2016-08-24 16:51:18', '0000-00-00 00:00:00', '0', null, null, '1');
INSERT INTO `ivearscms_page` VALUES ('147', '/Upload/image/201608/24/20160824165142_45516.jpg', '海德堡印刷机', '海德堡印刷机', '145', '速霸印刷机提供单张纸印刷市场中最完备的产品系列。从功能灵活且量身定制的速霸SM 与CD机型、到速霸SX 与 CX产品系列、再到巔峰级XL印刷机；由四开、八开直至对开和全开幅面的印刷机，速霸胶印机都能达到无可比拟', '2', '1', '', '', '', '2016-08-24 16:51:48', '0000-00-00 00:00:00', '0', null, null, '1');
INSERT INTO `ivearscms_page` VALUES ('148', '/Upload/image/201608/24/20160824170325_93196.png', '公司简介', '公司简介', '0', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">广州市伟烨彩色印刷有限公司成立于</span><span style=\"font-family:微软雅黑;font-size:12pt;\">2003年，是一家中澳合资开办的规模化、专业化的综合印刷服务供应商。历经12年的行业积淀，现已发展为集创意设计、文案策划、专业印刷及后期制作等服务于一体的现代化实力型企业，荣获“广东省印刷一类企业“，”政府指定采购单位“等多项殊荣。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">伟烨印刷全面实行ISO9001质量管理体系，以国\r\n际一流的设备、高水准的技术、环保的原料及工艺实现流程化作业，先后获得了FSC和ISO14001认证。公司先后引进全新德国进口海德堡、高宝大对开四\r\n色、五色胶印机，并应用时下最新的数码印刷海德堡CTP电脑直接制版系统实现便捷、简单、精确操作。公司还配备全新的折页机﹑装钉机﹑复膜机﹑啤机﹑自动\r\n粘盒机﹑UV机﹑烫金机等加工设备，提供设计、印刷、裱、啤、粘、烫金、UV、过胶、手工装配等加工一站式服务。公司以客户中心，需求为导向，致力于以优\r\n质的人才资源和先进的设备工艺为各类型企业提供从创意设计、文案策划、品质印刷及后期制作于一体的综合印刷服务解决方案。去年，公司年度销售总额突破5千\r\n万元，合作客户遍及国内乃至香港、澳门、东南亚、欧美等地区和国家</span><span style=\"font-family:\'Microsoft YaHei Western\';font-size:12pt;\">,&nbsp;</span><span style=\"font-family:微软雅黑;font-size:12pt;\">获得众多海内外知名企业的一致青睐与称赞。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">勿忘初心，方得始终。伟烨印刷始终秉持“客户为本，\r\n重视人才，精细管理，永续发展“的经营理念，不断探索行业发展趋势，储备和引进一流的设计队伍、技术人才和专业设备，面向海内外积极开拓市场，为大小企业\r\n和机构提供前沿的设计、精美的印刷和优越的服务，不断提升顾客的商业价值与市场影响力，实现企业、需求商和消费者多方共赢！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">面对未来，伟烨人表现地更加锐意进取：&nbsp;坚持以客户为中心，以市场为导向，不断提升企业管理水平、完善服务链条、提升生产效率，以全新姿态和诚实品格做各类企业机构的综合印刷服务优质供应商！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">未来无限精彩，我们携手共创！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务范围</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">各类高中档画册印刷、产品目录印刷、书刊杂志印刷、海报印刷、彩色包装盒印刷、PETPVC包装印刷、不干胶标签印刷、手挽袋印刷、服装吊牌印刷、台历/挂历印刷、单据表格印刷、信封信笺印刷等纸类印刷</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务客户</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">中国平安人寿、中英人寿保险、民生银行、五羊本田、中国邮政储蓄、陈李济药厂、广东省电信规划局等</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">公司资质</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">&nbsp; &nbsp; &nbsp; &nbsp;FSC森林认证；ISO9001体系认证；ISO14001环境管理体系认证</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">公司使命</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">印出专业品质，刷新客户体验</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">经营理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">客户为本，重视人才，精细管理，永续发展，只做有口皆碑的良心企业</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">管理理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">科学管理、精细分工、高效协作，创造平等、和谐、友好的工作环境</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">客户至上，诚信为基，时刻关注用户，服务尽善尽美</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:\'sans serif\';font-size:9pt;\">&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:23.2500pt;text-indent:0.0000pt;text-align:center;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">---卓伟品印&nbsp;&nbsp;烨彩生辉---</span> \r\n</p>', '3', '1', '', '', '', '2016-08-24 17:03:32', '2016-08-24 17:27:28', '0', null, null, '1');
INSERT INTO `ivearscms_page` VALUES ('149', '', '客户服务', '', '0', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">广州市伟烨彩色印刷有限公司成立于</span><span style=\"font-family:微软雅黑;font-size:12pt;\">2003年，是一家中澳合资开办的规模化、专业化的综合印刷服务供应商。历经12年的行业积淀，现已发展为集创意设计、文案策划、专业印刷及后期制作等服务于一体的现代化实力型企业，荣获“广东省印刷一类企业“，”政府指定采购单位“等多项殊荣。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">伟烨印刷全面实行ISO9001质量管理体系，以国\r\n际一流的设备、高水准的技术、环保的原料及工艺实现流程化作业，先后获得了FSC和ISO14001认证。公司先后引进全新德国进口海德堡、高宝大对开四\r\n色、五色胶印机，并应用时下最新的数码印刷海德堡CTP电脑直接制版系统实现便捷、简单、精确操作。公司还配备全新的折页机﹑装钉机﹑复膜机﹑啤机﹑自动\r\n粘盒机﹑UV机﹑烫金机等加工设备，提供设计、印刷、裱、啤、粘、烫金、UV、过胶、手工装配等加工一站式服务。公司以客户中心，需求为导向，致力于以优\r\n质的人才资源和先进的设备工艺为各类型企业提供从创意设计、文案策划、品质印刷及后期制作于一体的综合印刷服务解决方案。去年，公司年度销售总额突破5千\r\n万元，合作客户遍及国内乃至香港、澳门、东南亚、欧美等地区和国家</span><span style=\"font-family:\'Microsoft YaHei Western\';font-size:12pt;\">,&nbsp;</span><span style=\"font-family:微软雅黑;font-size:12pt;\">获得众多海内外知名企业的一致青睐与称赞。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">勿忘初心，方得始终。伟烨印刷始终秉持“客户为本，\r\n重视人才，精细管理，永续发展“的经营理念，不断探索行业发展趋势，储备和引进一流的设计队伍、技术人才和专业设备，面向海内外积极开拓市场，为大小企业\r\n和机构提供前沿的设计、精美的印刷和优越的服务，不断提升顾客的商业价值与市场影响力，实现企业、需求商和消费者多方共赢！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">面对未来，伟烨人表现地更加锐意进取：&nbsp;坚持以客户为中心，以市场为导向，不断提升企业管理水平、完善服务链条、提升生产效率，以全新姿态和诚实品格做各类企业机构的综合印刷服务优质供应商！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">未来无限精彩，我们携手共创！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务范围</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">各类高中档画册印刷、产品目录印刷、书刊杂志印刷、海报印刷、彩色包装盒印刷、PETPVC包装印刷、不干胶标签印刷、手挽袋印刷、服装吊牌印刷、台历/挂历印刷、单据表格印刷、信封信笺印刷等纸类印刷</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务客户</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">中国平安人寿、中英人寿保险、民生银行、五羊本田、中国邮政储蓄、陈李济药厂、广东省电信规划局等</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">公司资质</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">&nbsp; &nbsp; &nbsp; &nbsp;FSC森林认证；ISO9001体系认证；ISO14001环境管理体系认证</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">公司使命</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">印出专业品质，刷新客户体验</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">经营理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">客户为本，重视人才，精细管理，永续发展，只做有口皆碑的良心企业</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">管理理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">科学管理、精细分工、高效协作，创造平等、和谐、友好的工作环境</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务理念</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">客户至上，诚信为基，时刻关注用户，服务尽善尽美</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:\'sans serif\';font-size:9pt;\">&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:23.2500pt;text-indent:0.0000pt;text-align:center;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">---卓伟品印&nbsp;&nbsp;烨彩生辉---</span> \r\n</p>', '4', '1', '', '', '', '2016-08-24 18:07:38', '0000-00-00 00:00:00', '0', null, null, '1');
INSERT INTO `ivearscms_page` VALUES ('150', '', '联系我们', '', '0', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">广州市伟烨彩色印刷有限公司成立于</span><span style=\"font-family:微软雅黑;font-size:12pt;\">2003年，是一家中澳合资开办的规模化、专业化的综合印刷服务供应商。历经12年的行业积淀，现已发展为集创意设计、文案策划、专业印刷及后期制作等服务于一体的现代化实力型企业，荣获“广东省印刷一类企业“，”政府指定采购单位“等多项殊荣。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">伟烨印刷全面实行ISO9001质量管理体系，以国\r\n际一流的设备、高水准的技术、环保的原料及工艺实现流程化作业，先后获得了FSC和ISO14001认证。公司先后引进全新德国进口海德堡、高宝大对开四\r\n色、五色胶印机，并应用时下最新的数码印刷海德堡CTP电脑直接制版系统实现便捷、简单、精确操作。公司还配备全新的折页机﹑装钉机﹑复膜机﹑啤机﹑自动\r\n粘盒机﹑UV机﹑烫金机等加工设备，提供设计、印刷、裱、啤、粘、烫金、UV、过胶、手工装配等加工一站式服务。公司以客户中心，需求为导向，致力于以优\r\n质的人才资源和先进的设备工艺为各类型企业提供从创意设计、文案策划、品质印刷及后期制作于一体的综合印刷服务解决方案。去年，公司年度销售总额突破5千\r\n万元，合作客户遍及国内乃至香港、澳门、东南亚、欧美等地区和国家</span><span style=\"font-family:\'Microsoft YaHei Western\';font-size:12pt;\">,&nbsp;</span><span style=\"font-family:微软雅黑;font-size:12pt;\">获得众多海内外知名企业的一致青睐与称赞。</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">勿忘初心，方得始终。伟烨印刷始终秉持“客户为本，\r\n重视人才，精细管理，永续发展“的经营理念，不断探索行业发展趋势，储备和引进一流的设计队伍、技术人才和专业设备，面向海内外积极开拓市场，为大小企业\r\n和机构提供前沿的设计、精美的印刷和优越的服务，不断提升顾客的商业价值与市场影响力，实现企业、需求商和消费者多方共赢！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">面对未来，伟烨人表现地更加锐意进取：&nbsp;坚持以客户为中心，以市场为导向，不断提升企业管理水平、完善服务链条、提升生产效率，以全新姿态和诚实品格做各类企业机构的综合印刷服务优质供应商！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:12pt;\">未来无限精彩，我们携手共创！</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务范围</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">各类高中档画册印刷、产品目录印刷、书刊杂志印刷、海报印刷、彩色包装盒印刷、PETPVC包装印刷、不干胶标签印刷、手挽袋印刷、服装吊牌印刷、台历/挂历印刷、单据表格印刷、信封信笺印刷等纸类印刷</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">服务客户</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:0pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">中国平安人寿、中英人寿保险、民生银行、五羊本田、中国邮政储蓄、陈李济药厂、广东省电信规划局等</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:Wingdings;color:#0070C0;font-size:12pt;\">n</span><span style=\"font-family:\'Times New Roman\';color:#0070C0;font-size:7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:微软雅黑;color:#0070C0;font-weight:bold;font-size:12pt;\">公司资质</span><span style=\"font-family:\'sans serif\';font-size:9pt;\"></span> \r\n</p>\r\n<p class=\"p\" style=\"text-indent:-21pt;\">\r\n	<span style=\"font-family:微软雅黑;font-size:11pt;\">&nbsp; &nbsp; &nbsp; &nbsp;FSC森林认证；ISO9001体系认证；ISO14001环境管理体系认证</span><span style=\"font-family:\'sans serif\';font-size:9p