INSERT INTO `ivearscms_page` VALUES ('159', '/Upload/image/201608/25/20160825121935_82814.png', 'Company profile', 'Company profile', '0', 'Guangzhou Wei Ye Color Printing Co., Ltd. was established in 2003, is a Sino Australian joint-venture scale, professional and comprehensive printing service provider. After 12 years of industry accumulation, has now developed into a set of creative design, copywriting, professional printing and post production services in one of the modernization of the strength of enterprises, was awarded the \"Guangdong Province printing enterprises\", \"designated by the government procurement units\" and other awards.<br />\r\n<br />\r\nWei Ye printing full implementation of ISO9001 quality management system, to the world-class equipment, high standard of technology and environmental protection raw material and technology to implement the process of operation, has won the FSC certification and ISO14001. The company has introduced new German import Heidelberg, KBA big four color, color offset press, and applications nowadays the latest digital printing Heidelberg CTP computer direct plate making system realize convenient, precise and simple operation. Our company has also been equipped with new folding machine, binding machine, laminating machine, beer machine, automatic sticky box machine, UV machine, tipping machine, such as processing equipment to provide design, printing, laminating, beer, sticky, hot stamping, UV, glue, manual assembly and processing one-stop service. Company to customer center, demand oriented, committed to talent resources of high quality and advanced technology equipment for all types of businesses from creative design, copywriting, quality printing and post - making to the integrated printing services solutions. Last year, the company\'s total annual sales exceeded 50 million yuan, cooperative customers throughout the country and even Hongkong, Macao, Southeast Asia, Europe and the United States and other regions and countries, many well-known enterprises at home and abroad to obtain the unanimous favor and praise.<br />\r\n<br />\r\nDo not forget the early heart was always square. Wei Ye printing always uphold the \"customer for this, pay great attention to the talents, fine management, sustainable development\" business philosophy, and constantly explore the development trend of the industry, reserves and the introduction of first-class design team, technical personnel and professional equipment, oriented at home and abroad to actively explore the market, for the size of the enterprises and institutions to provide cutting-edge design and fine printing and superior service, and constantly improve the commercial value of customer and market influence, enterprise, demand for business and consumers win-win situation!<br />\r\n<br />\r\nIn the face of the future, Wei Yeren behave more forge ahead, adhere to the customer as the center, take the market as the guidance, improve enterprise management level, improve the service chain, improve production efficiency, with a new attitude and integrity of the supplier of high-quality comprehensive printing services for all types of enterprises, institutions.<br />\r\n<br />\r\nThe future is wonderful, we join hands in creating!<br />\r\n<br />\r\nN service scope<br />\r\n<br />\r\nAll kinds of high profile printing catalogs, product catalog printing, books and periodicals magazine printing, poster printing, color printing packing box, PETPVC printing and packaging, self-adhesive label printing, arm in arm printed bags, clothing label printing, calendar / calendar printing, document forms printing, envelope letterhead printed and printing paper<br />\r\n<br />\r\nN service client<br />\r\n<br />\r\nChina Ping An Life Insurance, in British life insurance, Minsheng Bank, Wuyang Honda, China postal savings, Chenji pharmaceutical factory, Guangdong Province Telecom Planning Bureau<br />\r\n<br />\r\nN company qualification<br />\r\n<br />\r\nFSC forest certification; ISO9001 system certification; ISO14001 environmental management system certification<br />\r\n<br />\r\nN company mission<br />\r\n<br />\r\nPrint professional quality, refresh customer experience<br />\r\n<br />\r\nN business philosophy<br />\r\n<br />\r\nCustomer oriented, talent, fine management, sustainable development, only the legendary corporate conscience<br />\r\n<br />\r\nN management concept<br />\r\n<br />\r\nScientific management, fine division of labor, high efficiency and cooperation to create an equal, harmonious and friendly working environment.<br />\r\n<br />\r\nN service concept<br />\r\n<br />\r\nCustomer first, good faith for the foundation, always concerned about the user, the service is perfect<br />\r\n<br />\r\nWeipin India - Zhuo Ye color and brightness.', '3', '1', '', '', '', '2016-08-25 10:43:11', '2016-08-25 12:19:37', '0', null, null, '2');
