INSERT INTO `ivearscms_product` VALUES ('85', '/Upload/image/201608/24/20160824164425_38995.jpg', '', '', 'PET/PVC印刷', '<p>\r\n	家用中央空调（又称为家庭中央空调、户式中央空调）是一个小型化的独立空调系统。基本构造类似于大型中央空调。通过一台主机通过风管、冷热水管或铜管连接多个末端出风口，将冷、暖气送到指定区域，来实现室内空气调节的目的。它结合了大型中央空调的便利、舒适、高档次以及传统小型分体机的简单灵活等多方面优势，是适用于别墅、公寓、家庭住宅、办公室和各种工业、商业场所的暗藏式空调。\r\n</p>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>\r\n<br />\r\n<p>\r\n	<img src=\"/Upload/image/201608/11/20160811155347_71633.jpg\" alt=\"\" height=\"204\" width=\"599\" />\r\n</p>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>\r\n<br />\r\n<p>\r\n	家用中央空调概念起源于美国，是商用空调的一个重要组成部分。家用中央空调将全部居室空间的空气调节和生活品质改善作为整体来实现，克服了分体式壁挂和柜式空调对分割室的局部处理和不均匀的空气气流等不足之处。目前，家用中央空调与单独供暖和精装修是高档物业的三大发展方向。\r\n</p>\r\n<br />\r\n<p>\r\n	“家用中央空调”是由一台主机通过风道送风或冷热水源带动多个末端的方式来控制不同的房间以达到室内空气调节的目的。它采用风管送风方式， 用一台主机即可控制多个不同房间，有效改善室内空气品质，预防空调病的发生。室内机可选择卧式暗装、明装吸顶、天花式、壁挂式等。各种风机盘管可独立控制。\r\n</p>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>\r\n<br />\r\n<p>\r\n	1、更高舒适度：中央空调是根据使用要求合理组织室内空气的流动，减少吹风管和降低空调出风的体感温差，从而改善空调环境的舒适度水平。让室内的空气达到充分的循环，通过不同的系统设计，更可以实现恒温恒湿、四季如春的室内环境。\r\n</p>\r\n<br />\r\n<p>\r\n	2、节约空间，个性化装修更美观：中央空调室外主机更少，更便于安装；室内部分以每个房间为单元，满足不同使用需求，并且采用暗藏方式安装，更容易配合屋内装修，达到最高的审美观，不占据室内空间，适应用户的个性化需求。\r\n</p>\r\n<br />\r\n<p>\r\n	3、改善空气品质，补充健康新风：中央空调可以配合新风系统，引入室外新鲜空气，提升空气品质，达到最舒适的状态。\r\n</p>\r\n<br />\r\n<p>\r\n	4、经济节能： 主机、室内机均由微电脑控制，每个区间末端风机盘管可自行调节温度，根据实际负荷系统做自动化运行，有效节约能源和运行费用，达到节能的要求。\r\n</p>', '296', '11', '', '', '', '', '0', '', '', '0', '', '0', null, '1', '', '', '', '0', '', '', '', '2016-08-24 16:44:27', '2016-08-25 09:29:58', '', '', '', '', '1');
