INSERT INTO `ivearscms_product` VALUES ('96', '/Upload/image/201608/25/20160825093426_26894.jpg', '', '', 'PET/PVC  printing', '<div class=\"textarea-wrap\">\r\n</div>\r\n<div class=\"output-bd\">\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">Household\r\n central air conditioning (also known as the family central air \r\nconditioning, household central air conditioning) is a small independent\r\n air-conditioning system.</span><span class=\"\"> The basic structure is similar to the large central air conditioning system.</span><span class=\"\"> Through a host through the wind pipe, hot and cold water pipes or tubes\r\n connected to multiple ends of the air outlet, the cold, heating to the \r\ndesignated area, to achieve the purpose of indoor air conditioning.</span><span class=\"\"> It combines the convenience of large central air-conditioning, \r\ncomfortable, high-grade and traditional small machine is simple and \r\nflexible, and many other advantages, is suitable for villas, apartments,\r\n home, office and all kinds of industrial and commercial places hidden \r\ntype air conditioner.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">The\r\n concept of home central air conditioning originated in the United \r\nStates, is an important part of commercial air conditioning.</span><span class=\"\"> Household central air conditioning will be to improve the air \r\nconditioning in the room space and quality of life as a whole to \r\nachieve, to overcome the shortcomings in the split type wall hanging \r\ntype and cabinet type air conditioning chamber partition of local \r\nprocessing and uneven air flow.</span><span class=\"\"> At present, the domestic central air conditioning and separate heating \r\nand fine decoration is the three major development direction of \r\nhigh-grade property.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">\"Household\r\n central air conditioning\" is the use of a host through the wind or cold\r\n and hot water supply to the end of the way to control different rooms \r\nin order to achieve the purpose of indoor air conditioning.</span><span class=\"\"> It uses the wind pipe to send the wind, with a host can control a \r\nnumber of different rooms, effectively improve the indoor air quality, \r\nprevent the occurrence of air conditioning disease.</span><span class=\"\"> The indoor machine can choose dark horizontal loading, with the ceiling, ceiling, wall etc..</span><span class=\"\"> Various fan coil units can be controlled independently.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">1,\r\n higher comfort: the central air conditioning is based on the use of \r\nreasonable organization of indoor air flow, reduce the air conditioning \r\nand air conditioning out of the temperature difference between the body,\r\n thereby improving the comfort level of air conditioning environment.</span><span class=\"\"> Let indoor air achieve full circulation, through different design of \r\nthe system, much more can be achieved with constant temperature and \r\nhumidity, the four seasons such as spring indoor environment.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">2, space saving, personalized decoration more beautiful: central \r\nair-conditioning outdoor unit less, easier to install; indoor part to \r\neach room as a unit, to meet the different demands, and the use of \r\nhidden installation, easier to cope with indoor decorate, reach the \r\nhighest aesthetic view, does not occupy the indoor space, to meet the \r\npersonalized needs of users.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">3, to improve the quality of air, add a healthy fresh air: central air\r\n conditioning can be combined with the new system, the introduction of \r\noutdoor fresh air, improve air quality, to achieve the most comfortable \r\nstate.</span> \r\n	</p>\r\n	<p class=\"ordinary-output target-output clearfix\">\r\n		<span class=\"\">4, economy and energy saving: host indoor machine were by the \r\nmicrocomputer control. At the end of each interval of fan coil can be \r\nself regulating temperature, according to the actual load system \r\nautomation operation, effectively save energy and operating cost, \r\nachieve energy-saving requirements.</span> \r\n	</p>\r\n</div>', '306', '11', '', '', '', '', '0', '', '', '0', '', '0', null, '1', '', '', '', '0', '', '', '', '2016-08-25 09:34:29', '2016-08-25 09:35:07', '', '', '', '', '2');
